import React from 'react';
import TextField from '@material-ui/core/TextField';


export function Search(){
    let cont = <div style={{backgroundColor:'black',width:'20%',height:'10%'}}>cont</div>
    return (
        <div style={{textAlign:'center',marginTop:'1%',width:'100%'}}>
            <TextField style={{width:'20%',height:'10%'}} label="Search" type="search" variant="outlined"/>
            {cont}
        </div>
    );
}
